import React from 'react';
import './index.css';

export default function Nav(props) {
  return (
    <div className="NavBar col-md-6">
      <p className="navItem float-start">home</p>
      <p className="navItem">about</p>
      <p className="navItem">projects</p>
      <p className="navItem">resume</p>
    </div>
  );
}
